import React from 'react';
import { Logo, Nav } from '../../ui';
import { StyledHeader, Wrapper } from './styles';

const Header: React.FC = () => {
  return (
    <StyledHeader>
      <Wrapper>
        <h1 className='visually-hidden'>Интернет-магазин "Девайс"</h1>
        <Logo />
        <form className='search-form' action="/" method="get">
          <label className="visually-hidden">Поиск по сайту</label>
          <input className="search navigation-status" type="search" name="page-search" value="Поиск по сайту" onChange={() => {}} />
            <button className="search-button" type="submit">Найти</button>
        </form>
        <Nav />
      </Wrapper>
    </StyledHeader>
  );
};

export default Header;
